        key:baby[Object.keys(baby)[0]],
        text:baby[Object.keys(baby)[1]]+" "+baby[Object.keys(baby)[2]],
        value:baby[Object.keys(baby)[1]]+" "+baby[Object.keys(baby)[2]]
    }))
    return (
        <div className="container">
            <div className="baby">
            <select id="B" name="babies" options={options}>
                {options.map(element => {
                   <option >{element[text]}</option> 
                })}
        </select>
            </div>
        </div>
    )
}

export default connect(
    state => ({
        babies: selectors.getAllBabies(state)
    }),
    undefined
